    [],nt"revision_timestamp": "2016-08-20T09:39:33.744211",nt"name": "willamette-valley-invasive-species-management-with-volunteers",nt"isopen":
    false,nt"url": null,nt"notes": "Volunteers worked with refuge staff to
    survey for and treat invasive species on the Willamette Valley Refuges (Ankeny,
    Baskett Slough and WL Finley NWR). False brome was mapped using GPS, enabling refuge
    staff to locate and treat plants along a hiking trail. Blackberry was hand cut in
    a native restoration unit to allow for future chemical treatment of smaller plants.
    Ivy was pulled in a riparian area allowing natives to regenerate where removed.
    Native plants were seeded and planted in various oak restoration sites. Trees planted
    by volunteers were maintained by mowing invasives around them.",nt"license_title":
